import { TextField } from "@mui/material";
import axios from "axios";
import { useEffect, useState } from "react";
import Table from "./Table";
import "./main.css";

const HomePage = () => {
  const [state, setState] = useState({
    datas: [],
  });
  useEffect(() => {
    getUuser();
  }, []);
  const getUuser = () => {
    axios
      .get("https://mongo6.sultantracker.com/api/bincry/sold")
      .then((res) => {
        const data = res.data;
        console.log(data);
        const old = { ...state };
        old.datas = data;
        setState(old);
      });
  };

  const totalBuyingPrice = state.datas.reduce(
    (acc, item) => acc + item.buying_amount,
    0
  );
  console.log(totalBuyingPrice);

  const byePrice = () => {};
  const bbb = state.datas[0].buying_amount;
  console.log("byeing price is :", bbb);
  return (
    <div
      style={{
        height: "100vh",
        width: "100%",
        background: "o",
        display: "flex",
        flexDirection: "column",
      }}
    >
      <div style={{ flex: 2, display: "flex" }}>
        <div style={{ flex: 5, display: "flex" }}>
          <div
            style={{
              flex: 3.33,
              display: "flex",
              flexDirection: "column",
              justifyContent: "center",
              alignItems: "center",
            }}
          >
            <h1>BUYING PRICE</h1>
            <div
              style={{ height: "40%", width: "50%", border: "1px solid black" }}
            >
              {totalBuyingPrice}
            </div>
          </div>
          <div
            style={{
              flex: 3.33,
              display: "flex",
              flexDirection: "column",
              justifyContent: "center",
              alignItems: "center",
            }}
          >
            <h1>SELLING PRICE</h1>
            <div
              style={{ height: "40%", width: "50%", border: "1px solid black" }}
            ></div>
          </div>
          <div
            style={{
              flex: 3.33,
              display: "flex",
              flexDirection: "column",
              justifyContent: "center",
              alignItems: "center",
            }}
          >
            <h1>PROFIT</h1>
            <div
              style={{ height: "40%", width: "50%", border: "1px solid black" }}
            ></div>
          </div>
        </div>
        <div
          style={{
            height: "10%",
            width: "40%",
            display: "flex",
            alignItems: "center",
            justifyContent: "center",
          }}
        >
          <TextField
            style={{ height: 80, width: "70%", padding: 20 }}
            placeholder="Search..."
            type="search"
          />
        </div>
      </div>
      <div
        style={{
          flex: 8,
          background: "red",
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
        }}
      >
        <div
          style={{
            height: "99%",
            width: "99%",
            background: "white",
            display: "flex",
            flexDirection: "column",
          }}
        >
          <div
            style={{
              flex: 1,
              width: "100%",
              background: "skyblue",
              display: "flex",
            }}
          >
            <h4 style={{ flex: 1.4, marginLeft: 5 }}>BUYING PRICE</h4>
            <h4 style={{ flex: 1.4, marginLeft: 5 }}>BUYING QUANTITY</h4>
            <h4 style={{ flex: 1.4, marginLeft: 5 }}>BUYING AMOUNT</h4>
            <h4 style={{ flex: 1.4, marginLeft: 5 }}>SELLING AMOUNT</h4>
            <h4 style={{ flex: 1.4, marginLeft: 5 }}>SELLING QUANTITY</h4>
            <h4 style={{ flex: 1.4, marginLeft: 5 }}>CURRENCY</h4>
            <h4 style={{ flex: 1.4, marginLeft: 5 }}>INSERT DATE</h4>
          </div>
          <div
            style={{
              flex: 9,
              width: "100%",
            }}
          >
            <div style={{ height: "99%", width: "100%", overflowY: "scroll" }}>
              {state.datas.map((item, i) => (
                <Table item={item} key={i} />
              ))}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default HomePage;
